import React, { useState } from 'react';
import { connect, useDispatch, useSelector } from "react-redux";

import FlagsLevelsСompleted from './FlagsLevelsСompleted';
import NavigationConsole from '../../components/Header/NavigationConsole';
import LevelBlock_1 from '../../components/Automation/LevelBlock_1';
import LevelBlock_2 from '../../components/Automation/LevelBlock_2';
import LevelBlock_3 from '../../components/Automation/LevelBlock_3';
import LevelBlock_4 from '../../components/Automation/LevelBlock_4';
import LevelBlock_5 from '../../components/Automation/LevelBlock_5';
import LevelBlock_6 from '../../components/Automation/LevelBlock_6';

function AutomationButtonsBlocks(props) {

    const dispatch = useDispatch();

    const stateNavigationConsole = [
        {
            to: '/',
            name: 'Home'
        },
        {
            to: '/products',
            name: 'Products'
        },
        {
            to: '/productsAbout',
            name: 'ProductsAbout'
        },
        {
            to: '/automation',
            name: 'Тренажер автоматизации звуков'
        }
    ]
    const namesLevelBlock = [
        'LevelBlock_1',
        'LevelBlock_2',
        'LevelBlock_3',
        'LevelBlock_4',
        'LevelBlock_5',
        'LevelBlock_6'
    ];
    const componentsLevelBlock = [
        <LevelBlock_1 letterAutomation={props.match.params.name} />,
        <LevelBlock_2 letterAutomation={props.match.params.name} />,
        <LevelBlock_3 letterAutomation={props.match.params.name} />,
        <LevelBlock_4 letterAutomation={props.match.params.name} />,
        <LevelBlock_5 letterAutomation={props.match.params.name} />,
        <LevelBlock_6 letterAutomation={props.match.params.name} />
    ]
    const [levelBlock, setLevelBlock] = useState(componentsLevelBlock[0]);

    const hendlerLevelEnd = () => {

    }
    const hendlerSelectLevelBlock = (data) => {
        setLevelBlock(componentsLevelBlock[data]);
    }
    return (
        <div className="automation-buttons-blocks">

            <div>
                Тип буквы {props.match.params.id} буква {props.match.params.name}

                <NavigationConsole
                    namesLevelBlock={namesLevelBlock}
                    onclick={hendlerSelectLevelBlock}
                    stateNavigationConsole={stateNavigationConsole}
                />
            </div>

            {levelBlock}

            <FlagsLevelsСompleted />
               
        </div>
        
     )
}

export default connect()(AutomationButtonsBlocks)
